import React from 'react';
import "./Feed.css";
import StoryReel from "./StoryReel";
import MessageSender from "./MessageSender";
import Post from "./Post";

function Feed() {
    return (
        <div className='feed'>
            <StoryReel/>
            <MessageSender/>
            <Post
                key={id}
                profilePic={profilePic}
                message={message}
                timestamp={timestamp}
                username={username}
                image={image}
            />
            <Post/>
            <Post/>
            
        </div>
    );
}

export default Feed;
